import re
import urllib.parse

def parse_lovable_projects(html_string):
    base_url = "https://lovable.dev"
    project_pattern = re.findall(r'<a href="(/projects/[^"]+)".*?<p[^>]*>(.*?)</p>.*?<p[^>]*>by</p>\s*<p[^>]*>(.*?)</p>.*?(?:<img.*?src="(/_next/image\?url=[^"]+)")?', html_string, re.DOTALL)
    
    projects = []
    
    for link, title, creator, image in project_pattern:
        full_link = f"{base_url}{link}"
        description = f"by {creator}"
        image_url = f"{base_url}{image}&w=750&q=75" if image else None
        
        project = {
            "platform": "lovable",
            "title": title.strip(),
            "description": description,
            "link": full_link,
            "image_url": image_url,
            "categories": [],
            "creator": creator.strip(),
            "creation_date": None
        }
        projects.append(project)
    
    return projects

